UCTS_DIR}/${AOT_WRAPPER_NAME}/Versions/A/${AOT_TARGET_NAME}\"\n\n# Copy the binary to the other architecture folder to have a complete framework in both.\ncp -a \"${BUILT_PRODUCTS_DIR}/${AOT_WRAPPER_NAME}/Versions/A/${AOT_TARGET_NAME}\" \"${AOT_OTHER_BUILT_PRODUCTS_DIR}/${AOT_WRAPPER_NAME}/Versions/A/${AOT_TARGET_NAME}\"\n\n# Copy the framework to the user's desktop\nditto \"${AOT_FRAMEWORK_LOCATION}\" \"${HOME}/Desktop/${AOT_WRAPPER_NAME}\"";
